import React from 'react';
import { Link } from 'react-router-dom';
import { Nav } from "tabler-react";
import { NavLink, withRouter } from "react-router-dom";

class Navbar extends React.Component {
    constructor(props){
        super(props)
        this.onClick = this.props.onClick;
        this.active = '/overview';
    }

    setActive(elem) {
        this.active = window.location.pathname;
        console.log(this.active);
        return;
    }

    isActive(elem) {
        if(elem == window.location.pathname)
            return true;
        return false;
    }

    render() {
        return (
            <Nav 
            items={
            <React.Fragment>
                <Nav.Item active={this.isActive('/overview')} to="/overview" value="Overview" icon="globe" onClick={() => this.setActive('/overview')}/>
                <Nav.Item active={this.isActive('/wallet')} to="/wallet" value="Wallet" icon="credit-card"onClick={() => this.setActive('/wallet')} />
                <Nav.Item active={this.isActive('/profile')} to="/profile" value="Profile" icon="user" onClick={() => this.setActive('/profile')}/>
                <Nav.Item to="/" value="Logout" onClick={() => this.onClick()} icon="log-out"/>
            </React.Fragment>
            }
        />);
    }
}

export default Navbar;
